webpackJsonp([74901329180841],{"./node_modules/json-loader/index.js!./.cache/json/cs-325.json":function(a,s){a.exports={data:{site:{siteMetadata:{author:"Bartholomew Joyce"}},markdownRemark:{html:'<h4><strong>Lecture 1</strong> – October 4th, 2017</h4>\n<p>Missed…</p>\n<h4><strong>Lecture 2</strong> – October 6th, 2017</h4>\n<h2><strong>Part 1</strong> Lexical Analyzer (Lexing)</h2>\n<p><a href="/e1bd2e36a9362af389447cc833684266.pdf">Slides</a></p>\n<h4><strong>Lecture 3</strong> – October 9th, 2017</h4>\n<h2>DFA to minimal DFA: Hopcroft’s algorithm</h2>\n<ol>\n<li>Given <span class="katex"><span class="katex-mathml"><math><semantics><mrow><mi>D</mi></mrow><annotation encoding="application/x-tex">D</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.68333em;"></span><span class="strut bottom" style="height:0.68333em;vertical-align:0em;"></span><span class="base"><span class="mord mathit" style="margin-right:0.02778em;">D</span></span></span></span> states in the DFA partition the states into two groups – <span class="katex"><span class="katex-mathml"><math><semantics><mrow><mi>F</mi></mrow><annotation encoding="application/x-tex">F</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.68333em;"></span><span class="strut bottom" style="height:0.68333em;vertical-align:0em;"></span><span class="base"><span class="mord mathit" style="margin-right:0.13889em;">F</span></span></span></span> and\n<span class="katex"><span class="katex-mathml"><math><semantics><mrow><mi>S</mi><mo>−</mo><mi>F</mi></mrow><annotation encoding="application/x-tex">S-F</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.68333em;"></span><span class="strut bottom" style="height:0.76666em;vertical-align:-0.08333em;"></span><span class="base"><span class="mord mathit" style="margin-right:0.05764em;">S</span><span class="mbin">−</span><span class="mord mathit" style="margin-right:0.13889em;">F</span></span></span></span>, the <em>accepting states</em> and the <em>nonaccepting states</em>. Denote this\ninitial partitioning as <span class="katex"><span class="katex-mathml"><math><semantics><mrow><mi>P</mi><mo>=</mo><mi>F</mi></mrow><annotation encoding="application/x-tex">P = F</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.68333em;"></span><span class="strut bottom" style="height:0.68333em;vertical-align:0em;"></span><span class="base"><span class="mord mathit" style="margin-right:0.13889em;">P</span><span class="mrel">=</span><span class="mord mathit" style="margin-right:0.13889em;">F</span></span></span></span>, <span class="katex"><span class="katex-mathml"><math><semantics><mrow><mi>S</mi><mo>−</mo><mi>F</mi></mrow><annotation encoding="application/x-tex">S-F</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.68333em;"></span><span class="strut bottom" style="height:0.76666em;vertical-align:-0.08333em;"></span><span class="base"><span class="mord mathit" style="margin-right:0.05764em;">S</span><span class="mbin">−</span><span class="mord mathit" style="margin-right:0.13889em;">F</span></span></span></span>.</li>\n<li>Let new partitioning <span class="katex"><span class="katex-mathml"><math><semantics><mrow><msub><mi>P</mi><mrow><mi>n</mi><mi>e</mi><mi>w</mi></mrow></msub><mo>=</mo><mi>P</mi></mrow><annotation encoding="application/x-tex">P_{new} = P</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.68333em;"></span><span class="strut bottom" style="height:0.83333em;vertical-align:-0.15em;"></span><span class="base"><span class="mord"><span class="mord mathit" style="margin-right:0.13889em;">P</span><span class="msupsub"><span class="vlist-t vlist-t2"><span class="vlist-r"><span class="vlist" style="height:0.151392em;"><span style="top:-2.5500000000000003em;margin-left:-0.13889em;margin-right:0.05em;"><span class="pstrut" style="height:2.7em;"></span><span class="sizing reset-size6 size3 mtight"><span class="mord mtight"><span class="mord mathit mtight">n</span><span class="mord mathit mtight">e</span><span class="mord mathit mtight" style="margin-right:0.02691em;">w</span></span></span></span></span><span class="vlist-s">​</span></span><span class="vlist-r"><span class="vlist" style="height:0.15em;"></span></span></span></span></span><span class="mrel">=</span><span class="mord mathit" style="margin-right:0.13889em;">P</span></span></span></span><br>\nFor each group <span class="katex"><span class="katex-mathml"><math><semantics><mrow><mi>G</mi></mrow><annotation encoding="application/x-tex">G</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.68333em;"></span><span class="strut bottom" style="height:0.68333em;vertical-align:0em;"></span><span class="base"><span class="mord mathit">G</span></span></span></span> in <span class="katex"><span class="katex-mathml"><math><semantics><mrow><msub><mi>P</mi><mrow><mi>n</mi><mi>e</mi><mi>w</mi></mrow></msub></mrow><annotation encoding="application/x-tex">P_{new}</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.68333em;"></span><span class="strut bottom" style="height:0.83333em;vertical-align:-0.15em;"></span><span class="base"><span class="mord"><span class="mord mathit" style="margin-right:0.13889em;">P</span><span class="msupsub"><span class="vlist-t vlist-t2"><span class="vlist-r"><span class="vlist" style="height:0.151392em;"><span style="top:-2.5500000000000003em;margin-left:-0.13889em;margin-right:0.05em;"><span class="pstrut" style="height:2.7em;"></span><span class="sizing reset-size6 size3 mtight"><span class="mord mtight"><span class="mord mathit mtight">n</span><span class="mord mathit mtight">e</span><span class="mord mathit mtight" style="margin-right:0.02691em;">w</span></span></span></span></span><span class="vlist-s">​</span></span><span class="vlist-r"><span class="vlist" style="height:0.15em;"></span></span></span></span></span></span></span></span><br>\npartition into subgroups such that two states <span class="katex"><span class="katex-mathml"><math><semantics><mrow><mi>s</mi></mrow><annotation encoding="application/x-tex">s</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.43056em;"></span><span class="strut bottom" style="height:0.43056em;vertical-align:0em;"></span><span class="base"><span class="mord mathit">s</span></span></span></span> and <span class="katex"><span class="katex-mathml"><math><semantics><mrow><mi>t</mi></mrow><annotation encoding="application/x-tex">t</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.61508em;"></span><span class="strut bottom" style="height:0.61508em;vertical-align:0em;"></span><span class="base"><span class="mord mathit">t</span></span></span></span> are in the same\nsubgroup if and only if for all input symbols <span class="katex"><span class="katex-mathml"><math><semantics><mrow><mi>a</mi></mrow><annotation encoding="application/x-tex">a</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.43056em;"></span><span class="strut bottom" style="height:0.43056em;vertical-align:0em;"></span><span class="base"><span class="mord mathit">a</span></span></span></span></li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/1b55b96245e48d1beff3d36cb866a884-61c4d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 259px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 62.54826254826254%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="DFA partitions"\n        title=""\n        src="/static/1b55b96245e48d1beff3d36cb866a884-61c4d.png"\n        srcset="/static/1b55b96245e48d1beff3d36cb866a884-88efc.png 148w,\n/static/1b55b96245e48d1beff3d36cb866a884-c7dd2.png 295w,\n/static/1b55b96245e48d1beff3d36cb866a884-61c4d.png 518w"\n        sizes="(max-width: 259px) 100vw, 259px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2><strong>Part 2</strong> Syntax Analyzer (Parsing)</h2>\n<h3>Overview</h3>\n<ul>\n<li>\n<p>Context free grammars (CFGs) – formal mechanism for</p>\n<ul>\n<li>specifying the syntax of the source language and</li>\n<li>a systematic method of determining membership in this formally specified\nlanguage</li>\n<li>we use context-free grammars to specify the grammatical structure of\nprogramming languages.</li>\n</ul>\n</li>\n<li>\n<p>Algorithms for doing this:</p>\n<ul>\n<li>Top-down parsing – <span class="katex"><span class="katex-mathml"><math><semantics><mrow><mi>L</mi><mi>L</mi><mo>(</mo><mn>1</mn><mo>)</mo></mrow><annotation encoding="application/x-tex">LL(1)</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.75em;"></span><span class="strut bottom" style="height:1em;vertical-align:-0.25em;"></span><span class="base"><span class="mord mathit">L</span><span class="mord mathit">L</span><span class="mopen">(</span><span class="mord mathrm">1</span><span class="mclose">)</span></span></span></span> and recursive descent parsers.</li>\n<li>Bottom-up parsing – <span class="katex"><span class="katex-mathml"><math><semantics><mrow><mi>L</mi><mi>R</mi><mo>(</mo><mn>1</mn><mo>)</mo></mrow><annotation encoding="application/x-tex">LR(1)</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.75em;"></span><span class="strut bottom" style="height:1em;vertical-align:-0.25em;"></span><span class="base"><span class="mord mathit">L</span><span class="mord mathit" style="margin-right:0.00773em;">R</span><span class="mopen">(</span><span class="mord mathrm">1</span><span class="mclose">)</span></span></span></span> parsers, canonical <span class="katex"><span class="katex-mathml"><math><semantics><mrow><mi>L</mi><mi>R</mi><mo>(</mo><mn>1</mn><mo>)</mo></mrow><annotation encoding="application/x-tex">LR(1)</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.75em;"></span><span class="strut bottom" style="height:1em;vertical-align:-0.25em;"></span><span class="base"><span class="mord mathit">L</span><span class="mord mathit" style="margin-right:0.00773em;">R</span><span class="mopen">(</span><span class="mord mathrm">1</span><span class="mclose">)</span></span></span></span> parsers, LALR parser.</li>\n</ul>\n</li>\n</ul>\n<p>Regular expressions are not sufficiently powerful to represent context-free\nstructures. It doesn’t understand recursion, for example.</p>\n<h2>Context Free Grammars (CFGs)</h2>\n<h3>Formally</h3>\n<ul>\n<li><span class="katex"><span class="katex-mathml"><math><semantics><mrow><mi>T</mi></mrow><annotation encoding="application/x-tex">T</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.68333em;"></span><span class="strut bottom" style="height:0.68333em;vertical-align:0em;"></span><span class="base"><span class="mord mathit" style="margin-right:0.13889em;">T</span></span></span></span> – A set of <em>terminal symbols</em></li>\n<li><span class="katex"><span class="katex-mathml"><math><semantics><mrow><mi>N</mi><mi>T</mi></mrow><annotation encoding="application/x-tex">NT</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.68333em;"></span><span class="strut bottom" style="height:0.68333em;vertical-align:0em;"></span><span class="base"><span class="mord mathit" style="margin-right:0.10903em;">N</span><span class="mord mathit" style="margin-right:0.13889em;">T</span></span></span></span> – A set of <em>nonterminals</em></li>\n<li><span class="katex"><span class="katex-mathml"><math><semantics><mrow><mi>S</mi></mrow><annotation encoding="application/x-tex">S</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.68333em;"></span><span class="strut bottom" style="height:0.68333em;vertical-align:0em;"></span><span class="base"><span class="mord mathit" style="margin-right:0.05764em;">S</span></span></span></span> – A designation of one of the nonterminals as the <em>start symbol</em></li>\n<li><span class="katex"><span class="katex-mathml"><math><semantics><mrow><mi>P</mi></mrow><annotation encoding="application/x-tex">P</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.68333em;"></span><span class="strut bottom" style="height:0.68333em;vertical-align:0em;"></span><span class="base"><span class="mord mathit" style="margin-right:0.13889em;">P</span></span></span></span> – A set of <em>productions</em>, where each production consists of a\nnonterminal, called the <em>head or left side</em> of the production, an\narrow and a sequence of terminals and/or nonterminal, called the\n<em>body or right side</em> of the production.</li>\n</ul>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/832fafd9fb0556f2178062932c13955c-df6fe.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 469px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 30.2771855010661%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Context free grammar"\n        title=""\n        src="/static/832fafd9fb0556f2178062932c13955c-ed4a0.png"\n        srcset="/static/832fafd9fb0556f2178062932c13955c-c6b11.png 148w,\n/static/832fafd9fb0556f2178062932c13955c-35ff1.png 295w,\n/static/832fafd9fb0556f2178062932c13955c-ed4a0.png 590w,\n/static/832fafd9fb0556f2178062932c13955c-afb00.png 885w,\n/static/832fafd9fb0556f2178062932c13955c-df6fe.png 938w"\n        sizes="(max-width: 469px) 100vw, 469px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Backus-Naur form (<strong>BNF</strong>)</h3>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>&lt;SheepNoise&gt; ::= baa &lt;SheepNoise&gt;\n               | baa</code></pre>\n      </div>\n<ul>\n<li>Nonterminal symbols wrapped in angle brackets <code>&#x3C;SheepNoise></code></li>\n<li>Terminal symbols underlined.</li>\n<li>The symbol <code>::=</code> means “derives,” and the symbol <code>|</code> means “also derives“</li>\n</ul>\n<h3>Ambiguous Grammars</h3>\n<p>Consider the grammar: <span class="katex"><span class="katex-mathml"><math><semantics><mrow><mi>E</mi><mo>→</mo><mi>E</mi><mo>+</mo><mi>E</mi><mi mathvariant="normal">∣</mi><mi>E</mi><mo>∗</mo><mi>E</mi><mi mathvariant="normal">∣</mi><mo>(</mo><mi>E</mi><mo>)</mo><mi mathvariant="normal">∣</mi><mtext>id</mtext></mrow><annotation encoding="application/x-tex">E \\rightarrow E + E | E \\ast E | (E) | \\text{id}</annotation></semantics></math></span><span class="katex-html" aria-hidden="true"><span class="strut" style="height:0.75em;"></span><span class="strut bottom" style="height:1em;vertical-align:-0.25em;"></span><span class="base"><span class="mord mathit" style="margin-right:0.05764em;">E</span><span class="mrel">→</span><span class="mord mathit" style="margin-right:0.05764em;">E</span><span class="mbin">+</span><span class="mord mathit" style="margin-right:0.05764em;">E</span><span class="mord mathrm">∣</span><span class="mord mathit" style="margin-right:0.05764em;">E</span><span class="mbin">∗</span><span class="mord mathit" style="margin-right:0.05764em;">E</span><span class="mord mathrm">∣</span><span class="mopen">(</span><span class="mord mathit" style="margin-right:0.05764em;">E</span><span class="mclose">)</span><span class="mord mathrm">∣</span><span class="mord text"><span class="mord mathrm">id</span></span></span></span></span></p>\n<p>Now consider the input: <code>id * id + id</code></p>\n<p>This input can be derived in two different ways:</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/df39d7b80a17d4c7dceeb81cbc9cd5e3-ae6cf.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 528px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 27.651515151515156%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Ambiguous Grammars"\n        title=""\n        src="/static/df39d7b80a17d4c7dceeb81cbc9cd5e3-67096.png"\n        srcset="/static/df39d7b80a17d4c7dceeb81cbc9cd5e3-6d88e.png 148w,\n/static/df39d7b80a17d4c7dceeb81cbc9cd5e3-bd048.png 295w,\n/static/df39d7b80a17d4c7dceeb81cbc9cd5e3-67096.png 590w,\n/static/df39d7b80a17d4c7dceeb81cbc9cd5e3-6aec5.png 885w,\n/static/df39d7b80a17d4c7dceeb81cbc9cd5e3-ae6cf.png 1056w"\n        sizes="(max-width: 528px) 100vw, 528px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h4><strong>Lecture 4</strong> – October 12th, 2017</h4>\n<h4><strong>Lecture 5</strong> – October 13th, 2017</h4>\n<h4><strong>Lecture 6</strong> – October 16th, 2017</h4>\n<h4><strong>Lecture 7</strong> – October 19th, 2017</h4>\n<h4><strong>Lecture 8</strong> – October 20th, 2017</h4>\n<h4><strong>Lecture 9</strong> – October 23rd, 2017</h4>',excerpt:"Lecture 1  – October 4th, 2017 Missed… Lecture 2  – October 6th, 2017 Part 1  Lexical Analyzer (Lexing) Slides Lecture 3  – October 9th…",frontmatter:{title:"CS325 Compiler Design",date:"October 03, 2017"}}},pathContext:{slug:"/cs325/"}}}});
